    public static int findMaxConsecutiveOnes1(int[] nums) {
        int prevZero = 0;
        int result = 0;
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] == 0) {
                if ((i - prevZero) > result) {
                    result = i - prevZero - 1;
                    prevZero = i;
                }
            }
        }
        return result;
    }

    public static int findMaxConsecutiveOnes(int[] nums) {
        int len = 0;
        int result = 0;
        for (int num : nums) {
            if (num == 1) {
                len++;
            } else {
                if (len > result) {
                    result = len;
                }
                len = 0;
            }
        }
        return Math.max(len, result);
    }
